    {ntt"total": 4,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-01-09T11:51:45.240014",nt"name": "determine-movement-patterns-and-survival-rates-of-central-valley-chinook-salmon-steelhead-and-t",nt"isopen":
    false,nt"url": null,nt"notes": "The projectu00e2u0080u0099s objective is
    to document movement patterns and survival rates of Chinook salmon, steelhead, green
    sturgeon, and other fish from several sources in the Central Valley of California.
    Juvenile salmonids from hatcheries or wild caught are implanted with small acoustic
    transmitters and the location of the fish are recorded on receivers that are placed
    throughout the watershed from Redding to the Golden Gate. Over 70 receiver locations
    with over 150 receivers monitor the movement of these fish. These receivers record
    the date, time, and unique identification number of transmitters that pass within
    listening range of the receivers. The first acoustic tagging studies began in 2006
    and continue today. ",nt"license_title": null,nt"extras": [{ntt"key":
